        "name": {
            "type": "field"
        },
        "initials": {
            "type": "string"
        },
        "full-layout": {
            "type": "string"
        },
        "text-position": {
            "type": "string"
        }
    },
    "_viewModelId": "AwAvatar",
    "_uniqueViewModelId": "AwAvatar"
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awAvatarRenderFunction, undefined, ctxImportObj );

export default Component;
